import React from "react";

export default function MasterFooterAdmin() {
  return (
    <div className="pl-4 pr-4 md:pl-8 md:pr-8 lg:pl-12 lg:pr-8 xl:pl-80 xl:pr-8 w-full bottom-0 bg-gray-100">
      <footer class="items-center justify-center w-full py-6 text-center border-t gap-y-6 gap-x-12 border-blue-gray-50 md:justify-between">
        <p class="block font-sans text-base antialiased font-normal leading-relaxed text-blue-gray-200">
          &copy; Dirawat dan dijaga oleh TIM IT BPYD
        </p>
      </footer>
    </div>
  );
}
